import React, { useState } from 'react';

function App() {
  const [data, setData] = useState(null);
  const [error, setError] = useState(null); 

  const handleClick = async () => {
    try {
      //const response = await fetch('https://jsonplaceholder.typicode.com/posts');//온라인에서 찾은 테스트 API URL  
      const response = await fetch('http://220.88.39.23:5000/api/user/token?username=12356&team=울산');//우리의 API URL

      if (!response.ok) {
        throw new Error(`网络请求失败，状态码：${response.status}`);
      }
      const result = await response.json(); 
      setData(result);
      setError(null); 
    } catch (err) {
      console.error('error:', err);
      setError(err.message); 
    }
  };

  return (
    <div>
      <button onClick={handleClick}>Get info</button>

      <div>
        <h3>Information </h3>
        {data ? (
          <pre>{JSON.stringify(data, null, 2)}</pre>
        ) : error ? (
          <p style={{ color: 'red' }}>error: {error}</p>
        ) : (
          <p>尚未获取数据</p>
        )}
      </div>
    </div>
  );
}

export default App;
